import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from './pages/Home.js';
import Header from './modules/Header';

export default function Routes(props) {
    return(
            <Switch>
                <Route path="/">

                    <Header/>
                    <Home/>

                </Route>

                <Route path="/monster">

                    <Header/>
                    <Detail />

                </Route>
            </Switch>
    
    )
}
